  implicit none
  integer, parameter :: wp  = kind(1.0D0)
  real(wp)::r(9,9)
  real(wp), parameter :: a = 2.d0 
contains
  function emsav(x,c) result(v)
    implicit none
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:14751)::p
    real(wp),dimension(0:14751)::c
    real(wp)::v
    
    call bemsav(x,p)
    v = dot_product(p,c)
    
    return
  end function emsav

function gemsav(flag,x,m,p,dp,c,xyz) result(g)
    implicit none
    integer :: flag
    real(wp),dimension(1:36)::x
    real(wp),dimension(0:4847)::m
    real(wp),dimension(0:14751)::p
    real(wp),dimension(0:14751)::dp
    real(wp),dimension(0:14751)::c
    real(wp)::xyz(9,3)
    real(wp)::g 
	call EvaldpBasisSet(flag,x,m,p,dp,xyz)
    g = dot_product(dp,c)
    return
  end function gemsav  

